import React from 'react'
import Button from './Button'

const Head = ({title,show,atask}) => {
    return (
    <div className='header'>
        <h1>{title}</h1>
        <Button onclick={()=>show(atask)} color='green' text='Add'/>
    </div>
  )
}
Head.defaultProps={
    title:"hello world"
}
export default Head
